(1, 'New Year', 'In the Gregorian calendar, New Year\'s Day is the first day of the calendar year, 1 January. Most solar calendars begin the year regularly at or near the northern winter solstice, while cultures', '2024-01-01', '2024-01-01', 'new-year878841664', 3, 56, '2024-01-05 11:44:26', '2024-01-08 09:26:42'),
(2, 'Makar Sankranti', 'Makar Sankranti, also referred to as Uttarayana, Makar, or simply Sankranti, is a Hindu observance and a festival. Usually falling on the date of January 14 annually', '2024-01-15', '2024-01-15', 'makar-sankranti687408725', 1, 56, '2024-01-08 09:54:59', '2024-01-08 09:54:59'),
(3, 'Chandramana Ugadi', 'Ugadi or Yugadi, also known as Samvatsarādi (meaning \"beginning of the year\"), is New Year\'s Day according to the Hindu calendar and is celebrated in the states of Andhra Pradesh, Telangana, Karnataka and Goa in India.', '2024-04-09', '2024-04-09', 'chandramana-ugadi1096383212', 6, 11, '2024-01-08 09:56:40', '2024-01-08 10:51:59');
