INSERT INTO `products` (`id`, `category_id`, `model`, `name`, `product_slug`, `product_price`, `primary_image`, `short_description`, `long_description`, `technical_info`, `general_info`, `support`, `video_link`, `keywords`, `warranty`, `status`, `tax_id`, `created_at`, `updated_at`) VALUES
(1, 2, '4100KB', 'cordless 64', 'cordless-641495322428', 41250.0000, 'mimes/products/UAf9GwjFn84ruckSxfi1Wje9qVqtfhI6I52YkSjB.jpg', '12MM LONG M2 CUTTER', '<p class=\"itemCopy fl\" style=\"color: rgb(33, 33, 33); font-family: Rubik, sans-serif; font-size: 13px;\"><span style=\"font-weight: bolder;\">125 mm (5″) 1,400 W Dustless Cutter, Dry Type</span></p><ul class=\"itemDescription\" style=\"padding-left: 20px; color: rgb(33, 33, 33); font-family: Rubik, sans-serif; font-size: 13px;\"><li>360° Rotatable Dust Collecting Port for Vacuum Cleaner / Dust Bag Connection</li><li>Compatible with optional guide rail for increased maneuverability</li><li>Dust cover to prevent dust scattering around</li><li>Dust proof switch covered with dust cover prevents contamination of motor</li><li>Powerful 1,400 W motor delivers 12,200 RPM</li><li>Up to 125 mm (5″) diameter diamond wheel can be used</li><li>Wide blade case enables use of curved diamond wheel</li><li>Cuts up to 40 mm (1-9/16″) with 125 mm (5″) wheel</li><li>Powerful cutting in stone, masonry, tile, concrete &amp; more</li><li>Flat motor housing allows tool to stand upright when changing blades</li><li>Large top handle design for increased comfort</li><li>Lock-on button for continuous use operation (for tool with lock-on button)</li><li>Two-stage safety trigger switch prevents accidental start up (for tool with lock-off button)</li><li>On-tool hex wrench for fast and easy blade changes and keeping it from lost</li><li>Externally accessible brushes for greater serviceability</li><li>Double insulated</li></ul>', '<ul class=\"technical_items\" style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 0px; padding: 0px 0px 0px 18px; list-style: none; color: rgb(33, 33, 33); font-family: Rubik, sans-serif; font-size: 13px; background-color: rgb(245, 245, 245);\"><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Continuous rating input :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\">1,400W</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Blade Diameter :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\"><table><tbody><tr><td colspan=\"2\">125 mm (5″)</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></td></tr></tbody></table><p style=\"margin-bottom: 0px;\">&nbsp;</p></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Max Cutting Capacity :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\"><table><tbody><tr><td colspan=\"2\">40.0 mm (1-9/16″)</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></td></tr></tbody></table><p style=\"margin-bottom: 0px;\">&nbsp;</p></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">No Load Speed (RPM) :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\">12,200</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Vibration Level :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\"><span style=\"font-weight: bolder;\">Concrete Cutting:&nbsp;</span>6.0 m/s²</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Vibration K Factor :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\"><span style=\"font-weight: bolder;\">Concrete Cutting:&nbsp;</span>1.5 m/s²</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Sound Pressure Level :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\"><table><tbody><tr><td colspan=\"2\">96 dB(A)</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Sound Power Level :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\">107 dB(A)</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; width: 200.156px;\">Noise K Factor :</div><div class=\"techinal_info_item_value\"><table><tbody><tr><td colspan=\"2\">3 dB(A)</td></tr><tr><th style=\"text-align: inherit;\"></th></tr></tbody></table></div></li><li style=\"display: flex; border-bottom: 1px solid rgb(221, 221, 221); padding: 8px 0px; position: relative;\"><div class=\"technical_item_title\" style=\"margin-right: 30px; 